      string: '{"files":[{"name":"BasicAlgo.cs","content":"namespace QuantConnect\n{\n    \/*\n    *   Basic
        Template Algorithm\n    *\n    *   The underlying QCAlgorithm class has many
        methods which enable you to use QuantConnect.\n    *   We have explained some
        of these here, but the full base class can be found at:\n    *   https:\/\/github.com\/QuantConnect\/Lean\/tree\/master\/Algorithm\n    *\/\n    public
        class BasicAlgo : QCAlgorithm\n    {\n        public override void Initialize()\n        {\n        \t\/\/
        backtest parameters\n            SetStartDate(2016, 1, 1);\n            SetStartDate(2016,
        1, 3);\n\n            \/\/ cash allocation\n            SetCash(25000);\n\n            \/\/
        request specific equities\n            \/\/ including forex. Options and futures
        in beta.\n            AddEquity(\"SPY\", Resolution.Minute);\n            \/\/AddForex(\"EURUSD\",
        Resolution.Minute);\n        }\n\n        \/*\n        *\tNew data arrives
        here.\n        *\tThe \"Slice\" data represents a slice of time, it has all
        the data you need for a moment.\n        *\/\n        public override void
        OnData(Slice data)\n        {\n        \t\/\/ slice has lots of useful information\n        \tTradeBars
        bars = data.Bars;\n        \tSplits splits = data.Splits;\n        \tDividends
        dividends = data.Dividends;\n\n        \t\/\/Get just this bar.\n        \tTradeBar
        bar;\n        \tif (bars.ContainsKey(\"SPY\")) bar = bars[\"SPY\"];\n\n            if
        (!Portfolio.HoldStock)\n            {\n                \/\/ place an order,
        positive is long, negative is short.\n                \/\/ Order(\"SPY\",  quantity);\n\n                \/\/
        or request a fixed fraction of a specific asset.\n                \/\/ +1
        = 100% long. -2 = short all capital with 2x leverage.\n                SetHoldings(\"SPY\",
        1);\n\n                \/\/ debug message to your console. Time is the algorithm
        time.\n                \/\/ send longer messages to a file - these are capped
        to 10kb\n                Debug(\"Purchased SPY on \" + Time.ToShortDateString());\n                \/\/Log(\"This
        is a longer message send to log.\");\n            }\n        }\n    }\n}","modified":"2017-11-11
        22:02:10"}],"success":true}'
